INSERT INTO CourseOutcome(sequenceNumber, description, courseId) VALUES ('7', 'Develop basic programming concepts including assignments, conditionals, loops, subroutines and common data types in a high-level programming language.', 'CSE110');
INSERT INTO CourseOutcome(sequenceNumber, description, courseId) VALUES ('8', 'Survey key subjects of computer science, such as algorithmic problem solving, computer organization, and the role of operating systems & compilers.', 'CSE110');
INSERT INTO CourseOutcome(sequenceNumber, description, courseId) VALUES ('9', 'Expose students to the Social and ethical issues of computing as a professional discipline.', 'CSE110');
INSERT INTO CourseOutcome(sequenceNumber, description, courseId) VALUES ('10', 'An ability to program in an object oriented  language, using concepts such as object classes, encapsulation, inheritance,  and polymorphism.', 'CSE114');
