INSERT INTO CourseOutcome(sequenceNumber, description, courseId) VALUES ('15', 'Write small programs in an exam environment to demonstrate his or her problem-solving abilities and proficiency with the language syntax.', 'CSE130');
INSERT INTO CourseOutcome(sequenceNumber, description, courseId) VALUES ('16', 'An ability to use logic and basic proof  techniques, such as mathematical induction.', 'CSE150');
